    def dialog_critical(self, s):
        """
        Show the critical-level message box.
        :param s: String type. The information to show.
        """
        dlg = QMessageBox(self)
        dlg.setText(s)
        dlg.setIcon(QMessageBox.Critical)
        dlg.show()

    def file_open(self):
        """
        Open the data file.
        """
        path, _ = QFileDialog.getOpenFileName(self, u"打开", "", u"表格数据(*.xlsx;*.xls;*.xlsm;*.csv;*.ods)")
        if not path:
            # If dialog is cancelled, will return ""
            return
        try:
            records = pyexcel.get_records(file_name=path)
        except Exception as e:
            self.dialog_critical(str(e))
        else:
            self.path = path
            for record in records:
                self.uiwidget.add_line(record)
            self.update_title()

    def file_save(self):
        """
        Save file.
        """
        if self.path is None:
            # If we do not have a path, we need to use Save As.
            return self.file_saveas()
        try:
            content = self.uiwidget.get_book()
            book = pyexcel.get_book(bookdict=content)
            if os.path.splitext(os.path.basename(self.path))[1] == '.csv':
                book.save_as(self.path, encoding='utf-8-sig')
            else:
                book.save_as(self.path)
            self.update_title()

        except Exception as e:
            self.dialog_critical(str(e))

    def file_saveas(self):
        """
        Save file as...
        """
        path, _ = QFileDialog.getSaveFileName(
            self, u"保存", "", u"xlsx文件(*.xlsx);;xls文件(*.xls);;xlsm文件(*.xlsm);;csv文件(*.csv);;ods文件(*.ods)")
        if not path:
            # If dialog is cancelled, will return ""
            return
        try:
            content = self.uiwidget.get_book()
            book = pyexcel.get_book(bookdict=content)
            if os.path.splitext(os.path.basename(path))[1] == '.csv':
                book.save_as(path, encoding='utf-8-sig')
            else:
                book.save_as(path)
        except Exception as e:
            self.dialog_critical(str(e))
        else:
            self.path = path
            self.update_title()

    def file_print(self):
        """
        Print this file.
        """
        dlg = QPrintDialog()
        if dlg.exec_():
            self.handle_print_request(dlg.printer())

    def update_title(self):
        """
        Update the window's title.
        """
        self.setWindowTitle(u"%s - 学生成绩核算系统" % (os.path.basename(self.path) if self.path else "Untitled"))

    def handle_print_request(self, printer):
        """
        What we need to print is a table. This method converts the table and some special items into printable mode.
        :param printer: A printer to use.
        """
        document = QTextDocument()
        cursor = QTextCursor(document)
        table = cursor.insertTable(self.uiwidget.table.rowCount() + 1, self.uiwidget.table.columnCount())

        for h in self.uiwidget.headers:
            cursor.insertText(h)
            cursor.movePosition(QTextCursor.NextCell)

        for row in range(table.rows()):
            for col in range(table.columns()):
                w = self.uiwidget.table.cellWidget(row, col)
                it = self.uiwidget.table.item(row, col)
                if w is not None:
                    cursor.insertText(u'☑' if self.uiwidget.table.item(row, col + 1).text() in self.uiwidget.selected
                                      else u'☐')
                elif it is not None:
                    cursor.insertText(it.text())
                cursor.movePosition(QTextCursor.NextCell)
        document.print_(printer)


