    def add_line(self, data=None):
        """
        Add a new line to the table area. If `data` is provided, it will load data from the `data`.
        :param data: The data to load. Default is none. In this case, it will use random data to fill the table.
        """
        row = self.table.rowCount()
        self.table.setRowCount(row + 1)
        stu_id = 'B17' + '%06d' % self.stu_id if not data else str(data[self.headers[1]])
        ck = QCheckBox()
        ck.stateChanged.connect(lambda: (lambda s, status: self.selected.add(s) if status else self.selected.discard(s))
                                        (stu_id, ck.isChecked()))
        h = QHBoxLayout()
        h.setAlignment(Qt.AlignCenter)
        h.addWidget(ck)
        w = QWidget()
        w.setLayout(h)
        if data:
            name = data[self.headers[2]] if self.headers[2] in data else ''
            description = data[self.headers[7]] if self.headers[7] in data else ''
        else:
            name = self.faker.name()
            description = self.faker.address()
            self.stu_id += 1
        self.table.setCellWidget(row, 0, w)
        self.table.setItem(row, 1, QTableWidgetItem(stu_id))
        self.table.setItem(row, 2, QTableWidgetItem(name))
        # it will set integer instead of string
        item = QTableWidgetItem()
        item.setData(Qt.EditRole, float(data[self.headers[3]]) if (data and self.headers[3] in data) else round(
            random.uniform(50, 100), 1))
        self.table.setItem(row, 3, item)

        item = QTableWidgetItem()
        item.setData(Qt.EditRole, float(data[self.headers[4]]) if (data and self.headers[4] in data) else round(
            random.uniform(50, 100), 1))
        self.table.setItem(row, 4, item)

        item = QTableWidgetItem()
        item.setData(Qt.EditRole, float(data[self.headers[5]]) if (data and self.headers[5] in data) else round(
            random.uniform(50, 100), 1))
        self.table.setItem(row, 5, item)

        if data and self.headers[6] in data:
            item = QTableWidgetItem()
            item.setData(Qt.EditRole, float(data[self.headers[6]]))
            self.table.setItem(row, 6, item)
        else:
            self.table.setItem(row, 6, QTableWidgetItem(''))

        self.table.setItem(row, 7,
                           QTableWidgetItem(str(data[self.headers[7]]) if (data and self.headers[7] in data) else ''))

        self.table.setItem(row, 8, QTableWidgetItem(description))
        for y in range(1, 9):
            item = self.table.item(row, y)
            item.setTextAlignment(Qt.AlignCenter)

    def del_line(self):
        """
        Delete a line.
        """
        row = self.table.rowCount()
        for x in range(row, 0, -1):
            # keyword: stu_id
            if self.table.item(x - 1, 1).text() in self.selected:
                self.table.removeRow(x - 1)
        self.selected.clear()

    def modify_line(self):
        """
        Decide whether the line can be edited or not.
        """
        if self.editable:
            self.table.setEditTriggers(QAbstractItemView.NoEditTriggers)
            self.btn_modify.setText(u"可以编辑")
            self.editable = False
        else:
            self.table.setEditTriggers(QAbstractItemView.AllEditTriggers)
            self.btn_modify.setText(u"禁止编辑")
            self.editable = True

    def select_line(self):
        """
        Select the whole line instead of a cell.
        """
        if self.table.selectionBehavior() == 0:
            self.table.setSelectionBehavior(1)
            self.btn_select_line.setStyleSheet('background-color:lightblue')
        else:
            self.table.setSelectionBehavior(0)
            self.btn_select_line.setStyleSheet('')

    def deny_muti_line(self):
        """
        Determines whether multiple lines can be selected. The default is yes.
        """
        if self.table.selectionMode() in [2, 3]:
            self.table.setSelectionMode(QAbstractItemView.SingleSelection)
            self.btn_select_single.setStyleSheet('background-color:lightblue')
        else:
            self.table.setSelectionMode(QAbstractItemView.ExtendedSelection)
            self.btn_select_single.setStyleSheet('')

