    def calculate_total_mark(self):
        """
        Calculate the total mark and set them to the table.
        """
        row = self.table.rowCount()
        for x in range(row):
            regular = float(self.table.item(x, 3).text()) if is_number(self.table.item(x, 3).text()) else 0.00
            midterm = float(self.table.item(x, 4).text()) if is_number(self.table.item(x, 4).text()) else 0.00
            final = float(self.table.item(x, 5).text()) if is_number(self.table.item(x, 5).text()) else 0.00

            total_mark = 0.3 * regular + 0.3 * midterm + 0.4 * final
            background = self.table.item(x, 6).background()

            item = QTableWidgetItem()
            item.setData(Qt.EditRole, round(total_mark, 2))
            self.table.setItem(x, 6, item)

            if total_mark >= 90:
                self.table.setItem(x, 7, QTableWidgetItem('A'))
            elif 80 <= total_mark < 90:
                self.table.setItem(x, 7, QTableWidgetItem('B'))
            elif 70 <= total_mark < 80:
                self.table.setItem(x, 7, QTableWidgetItem('C'))
            elif 60 <= total_mark < 70:
                self.table.setItem(x, 7, QTableWidgetItem('D'))
            else:
                self.table.setItem(x, 7, QTableWidgetItem('E'))

            self.table.item(x, 6).setBackground(background)
            self.table.item(x, 6).setTextAlignment(Qt.AlignCenter)
            self.table.item(x, 7).setBackground(background)
            self.table.item(x, 7).setTextAlignment(Qt.AlignCenter)

    def get_ave_totol_mark(self):
        """
        Calculate the average mark and show it on the message box.
        """
        row = self.table.rowCount()
        total_mark = 0.00
        for x in range(row):
            regular = float(self.table.item(x, 3).text()) if is_number(self.table.item(x, 3).text()) else 0.00
            midterm = float(self.table.item(x, 4).text()) if is_number(self.table.item(x, 4).text()) else 0.00
            final = float(self.table.item(x, 5).text()) if is_number(self.table.item(x, 5).text()) else 0.00
            total_mark += 0.3 * regular + 0.3 * midterm + 0.4 * final
        try:
            total_mark = total_mark / row
        except ZeroDivisionError:
            total_mark = 0.00
        QMessageBox.information(self, u"班级总平均成绩", u"班级总平均成绩为：%.2f。" % total_mark, QMessageBox.Cancel)

    def get_ratio(self):
        """
        Draw a fan chart of the grade distribution of the whole class.
        """
        labels = [u"优秀\n(90-100)", u"良好\n(80-89)", u"中等\n(70-79)", u"及格\n(60-69)", u"不及格\n(60分以下)"]
        data = [0, 0, 0, 0, 0]
        row = self.table.rowCount()
        for x in range(row):
            regular = float(self.table.item(x, 3).text()) if is_number(self.table.item(x, 3).text()) else 0.00
            midterm = float(self.table.item(x, 4).text()) if is_number(self.table.item(x, 4).text()) else 0.00
            final = float(self.table.item(x, 5).text()) if is_number(self.table.item(x, 5).text()) else 0.00
            total_mark = 0.3 * regular + 0.3 * midterm + 0.4 * final
            if total_mark >= 90:
                data[0] += 1
            elif 80 <= total_mark < 90:
                data[1] += 1
            elif 70 <= total_mark < 80:
                data[2] += 1
            elif 60 <= total_mark < 70:
                data[3] += 1
            else:
                data[4] += 1
        # make a square figure
        plt.figure(1, figsize=(6, 6))
        # For China, make the piece explode a bit
        explode = [0.1, 0, 0, 0, 0]
        # Colors used. Recycle if not enough.
        colors = ["red", "blue", "yellow", "green", "orange"]
        # Pie Plot
        # autopct: format of "percent" string;
        patches, l_text, p_text = plt.pie(data, explode=explode, colors=colors, labels=labels, autopct='%1.1f%%',
                                          pctdistance=0.7, shadow=True, startangle=90,
                                          wedgeprops={'linewidth': 0.5, 'edgecolor': "black"})
        for t in l_text:
            t.set_size(14)
        for t in p_text:
            t.set_size(20)
        plt.title(u"班级成绩分布图", bbox={'facecolor': '0.8', 'pad': 5}, fontsize=17)
        plt.show()

    def set_range(self):
        """
        Divide the sections according to the scores and distinguish them with different colors.
        """
        def set_color_to_row(table, row_count, color, highlight=True):
            if highlight:
                for j in range(table.columnCount()):
                    try:
                        self.origin_color[row_count] = table.item(row_count, j).background()
                        table.item(row_count, j).setBackground(QColor(color))
                    except AttributeError:
                        table.cellWidget(row_count, j).setStyleSheet('background-color:%s' % color)
            else:
                for j in range(table.columnCount()):
                    try:
                        table.item(row_count, j).setBackground(self.origin_color[row_count])
                    except AttributeError:
                        table.cellWidget(row_count, j).setStyleSheet('')
                    except KeyError:
                        pass

        row = self.table.rowCount()
        for x in range(row):
            regular = float(self.table.item(x, 3).text()) if is_number(self.table.item(x, 3).text()) else 0.00
            midterm = float(self.table.item(x, 4).text()) if is_number(self.table.item(x, 4).text()) else 0.00
            final = float(self.table.item(x, 5).text()) if is_number(self.table.item(x, 5).text()) else 0.00
            total_mark = 0.3 * regular + 0.3 * midterm + 0.4 * final

            if total_mark >= 90:
                set_color_to_row(self.table, x, 'pink', self.highlight)
            elif 80 <= total_mark < 90:
                set_color_to_row(self.table, x, 'lightblue', self.highlight)
            elif 70 <= total_mark < 80:
                set_color_to_row(self.table, x, 'yellow', self.highlight)
            elif 60 <= total_mark < 70:
                set_color_to_row(self.table, x, 'lightgreen', self.highlight)
            else:
                set_color_to_row(self.table, x, 'lightgray', self.highlight)

        if self.highlight:
            self.btn_highlight.setText(u"取消区间高亮")
            self.highlight = False
        else:
            self.btn_highlight.setText(u"区间高亮")
            self.highlight = True

    def set_header(self):
        """
        Make the header of the table beautiful.
        """
        font = QFont(u'微软雅黑', 10)
        font.setBold(True)
        self.table.horizontalHeader().setFont(font)
        self.table.setColumnWidth(0, 80)
        self.table.setColumnWidth(8, 198)
