    def get_book(self):
        """
        get the table data.
        :return: dict. A book of pyexcel format.
        """
        book = [self.headers[1:]]
        row = self.table.rowCount()
        for x in range(1, row):
            row_data = (self.table.item(x, 1).text(),
                        self.table.item(x, 2).text(),
                        self.table.item(x, 3).text(),
                        self.table.item(x, 4).text(),
                        self.table.item(x, 5).text(),
                        self.table.item(x, 6).text(),
                        self.table.item(x, 7).text(),
                        self.table.item(x, 8).text())
            book.append(row_data)
        return {'Sheet 1': book}
